import react from "react";
import { useState } from "react";
import './Form.css'

export default function Form () {

    const [name, setName] = useState(' ');
    const [weight, setWeight] = useState('');
    const [height, setHeight] = useState('');
    const [lifeSpan, setLifeSpan] = useState('');

    return (
        <form>

            <div className="field">
                <label>Name :</label>
                <input type="text" name="name" value={name} onChange={(e) => setName(e.target.value)}/>
            </div>

            <div className="field">
                <label>Weight :</label>
                <input type="text" name="weight" value={weight} onChange={(e) => setWeight(e.target.value)}/>
            </div>

            <div className="field">
                <label>Height :</label>
                <input type="text" name="height" value={height} onChange={(e) => setHeight(e.target.value)}/>
            </div>

            <div className="field">
                <label>Life span :</label>
                <input type="text" name="lifeSpan" value={lifeSpan} onChange={(e) => setLifeSpan(e.target.value)}/>
            </div>

            <input type="submit" value="Submit"/>

        </form>
    )
}
